import React, { useEffect, useState } from 'react';

import './index.css';
import 'bootstrap/dist/css/bootstrap.css'

function App() {

  return (
    <div className="container">
      <div className="row">
        <h1 className="col-1">Registro</h1>
      </div>  
      <label>
        Nombre de la empresa:<input name="N_empresa" defaultValue="nombre" />
      </label><br />
      <label>
        Cedula juridica:<input name="Id_juridico" defaultValue="ID" />
      </label>
      <label><br />
        Telefono:<input name="Tel_1" defaultValue="666-666" />
      </label>
      <label><br />
        Correo de la empresa:<input name="Ecorreo" defaultValue="@gmail.com" />
      </label>
      <label><br />
        telefono recursos humanos:<input name="Recursos_h" defaultValue="392138103" />
      </label>

    </div>
  );
}

// Exportamos el componente 'App' como el componente predeterminado de este módulo.
export default App;
